import React from 'react'
import { NavLink } from 'react-router-dom'


const NavbarA = () => {
  return (
    <div>
  

    <NavLink style={{color:"#2266e6",fontSize:"45px",textDecoration:"none"}} to="/">myfitnesspal</NavLink>
    <NavLink style={{color:"#2266e6",fontSize:"20px",textDecoration:"none"}} to='/login'>LOGIN</NavLink>
    <NavLink style={{color:"#2266e6",fontSize:"20px",textDecoration:"none"}} to="/signup">SIGNUP</NavLink>

    </div>
  )
}

export default NavbarA
